import React from "react";

const Crawl = ({ youtubeId }) => {
  return (
    <div
      className="video"
      style={{
        position: "relative",
        paddingBottom: "56.25%" /* 16:9 */,
        paddingTop: 25,
        height: 0
      }}
    >
      {/* <iframe */}
      <iframe
        style={{
          position: "absolute",
          top: 0,
          left: 5,
          width: "95%",
          height: "80%"
        }}
        src="https://www.youtube.com/embed/iXDnFYu91vY"
        frameborder="0"
        allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
        allowfullscreen
      ></iframe>
    </div>
  );
};

export default Crawl;
